import React from "react";
import Banner from "../components/Banner";
import NavBar from "../components/NavBar";
import JobList from "../components/JobList";

const Jobs = () => {
  return (
    <div>
      <NavBar />
      <Banner />
      <JobList />
    </div>
  );
};

export default Jobs;
